import {BrowserRouter, Routes, Route} from 'react-router-dom'
import './App.css';
import Inicio from './components/Inicio'
import Mercados from './components/Mercados'

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path={"/"} element={<Inicio/>}/>
          <Route path={"/markets"} element={<Mercados/>}/>
          <Route path={"/markets/:market_id"} element={<Mercados/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;



const Koa = require('koa');
const koaBody = require('koa-body');
const KoaLogger = require('koa-logger');
const cors = require('@koa/cors');
const router = require('./routes');
const orm = require('./models');
const session = require('koa-session');
const koaJWT = require('koa-jwt');
const protected_router = require('./routes/protected');

const PORT = 3000;
//const cors = require('cors');
const app = new Koa();

// Atach Sequelize ORM to the context of the App
app.context.orm = orm;

app.use(cors({ credentials: true }));

// Logs requests from the server
app.use(KoaLogger());

// Parse Request Body
app.use(koaBody());

app.keys = [`${process.env.APP_KEYS}`];

const CONFIG = {
    httpOnly: false,
}
app.use(session(CONFIG, app));

app.use(router.routes());

app.use(koaJWT({secret:`${process.env.JWT_SECRET}`, key: 'tokendata'}))

app.use(protected_router.routes());

module.exports = app;
